// SPDX-License-Identifier: UNLICENSED 
pragma solidity ^0.8.0;

contract VolcanoCoin {
    uint256 public TOTAL_SUPPLY = 10000;
    address owner;

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner {
        if (msg.sender == owner) {
            _;
        }
    }

    function increaseTotalSupply(uint256 _OTAL_SUPPLY) public onlyOwner returns(uint256) {
        TOTAL_SUPPLY = TOTAL_SUPPLY + 10000;
        return TOTAL_SUPPLY;
    }
}

